import React from "react";
import Blog from './blog.jsx';
import Cont from './Content.jsx';

function App(){
    return(
    <div className="hero-section">
      <div className="card-grid">
         {Cont.map((value, index) => {
           
           return(
               <Blog
                   key={index}
                   content={value.content}
                   title={value.title}
               />
           );
           })}
      </div>
    </div>
    );
}

export default App;
